import React from 'react';
import ExpenseItem from "./ExpenseItem";

const ExpensesList = props => {
    let expenses = props.items.length === 0 ? <p>No Expenses</p> : props.items.map(expense => <ExpenseItem date={expense.date} title={expense.title} amount={expense.amount} key={expense.id} />)
}

export default ExpensesList;
